function writeSections(){
    $.get("$val(BASE_URL)/contents/node/code/CONTENTS--1739437642059?payloadOnly=true", function(data, status){
     if(data && data.length > 0){
        $('#contents').html("");
         data.forEach(section=>{
             if(section.title){
                $('#contents').append('<section id="about" class="py-5 text-center">'+ 
                '<div class="container">'+ 
                '<div class="mb-4">'+ 
                '<img src="'+section.picture+'/file" alt="'+section.title+'" class="rounded-circle img-fluid w-25">'+ 
                '</div>'+ 
                '<h2 class="fw-bold mb-3">'+section.title+'</h2>'+ 
                '<p class="lead text-muted">'+ section.content+'</p>'+
                '</div>'+ 
                '</section>'
                );
             }
         });
     }
    });
}

writeSections();

